import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { useTheme } from '@mui/material/styles';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import TrendingDownIcon from '@mui/icons-material/TrendingDown';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <Paper
        elevation={0}
        sx={{
          mb: 1,
          bgcolor: 'background.default',
          border: 1,
          borderColor: pair.is_blacklisted ? 'error.light' : 'divider',
          borderRadius: 2,
          overflow: 'hidden',
          transition: 'all 0.2s',
          '&:hover': {
            transform: 'translateY(-2px)',
            bgcolor: 'background.paper',
            borderColor: pair.is_blacklisted ? 'error.main' : 'primary.light',
            boxShadow: 2
          }
        }}
      >
        <Box
          onClick={handleRowClick}
          sx={{
            cursor: 'pointer',
            p: 2,
            display: 'flex',
            alignItems: 'center',
            gap: 2
          }}
        >
          {/* Expand Icon */}
          <IconButton
            size="small"
            sx={{
              transition: 'all 0.2s',
              transform: open ? 'rotate(-180deg)' : 'rotate(0)',
              color: open ? 'primary.main' : 'text.secondary',
            }}
          >
            <KeyboardArrowDownIcon />
          </IconButton>

          {/* Token Info */}
          <Box sx={{ display: 'flex', alignItems: 'center', flex: 2, gap: 1.5 }}>
            <Avatar 
              src={pair.logoURI} 
              alt={pair.symbol}
              sx={{ width: 32, height: 32 }}
            />
            <Box>
              <Typography variant="subtitle2" sx={{ fontWeight: 600 }}>
                {pair.symbol}
              </Typography>
              <Typography variant="caption" color="text.secondary">
                {pair.name}
              </Typography>
            </Box>
          </Box>

          {/* Price Change */}
          <Box sx={{ flex: 1 }}>
            <Box
              sx={{
                display: 'inline-flex',
                alignItems: 'center',
                gap: 0.5,
                px: 1,
                py: 0.5,
                borderRadius: 1,
                bgcolor: (pair.priceChange || 0) >= 0 ? 'success.lighter' : 'error.lighter',
                color: (pair.priceChange || 0) >= 0 ? 'success.main' : 'error.main'
              }}
            >
              {(pair.priceChange || 0) >= 0 ? 
                <TrendingUpIcon fontSize="small" /> : 
                <TrendingDownIcon fontSize="small" />
              }
              <Typography variant="caption" sx={{ fontWeight: 600 }}>
                {(pair.priceChange || 0) >= 0 ? '+' : ''}{(pair.priceChange || 0)?.toFixed(2)}%
              </Typography>
            </Box>
          </Box>

          {/* Volume */}
          <Box sx={{ flex: 1, textAlign: 'right' }}>
            <Typography variant="subtitle2" sx={{ fontWeight: 500 }}>
              ${(pair.volume || 0).toLocaleString()}
            </Typography>
            <Typography variant="caption" color="text.secondary">
              24h Volume
            </Typography>
          </Box>

          {/* Liquidity */}
          <Box sx={{ flex: 1, textAlign: 'right' }}>
            <Typography variant="subtitle2" sx={{ fontWeight: 500 }}>
              ${(pair.liquidity || 0).toLocaleString()}
            </Typography>
            <Typography variant="caption" color="text.secondary">
              Liquidity
            </Typography>
          </Box>

          {/* Market Cap */}
          <Box sx={{ flex: 1, textAlign: 'right' }}>
            <Typography variant="subtitle2" sx={{ fontWeight: 500 }}>
              ${(pair.marketCap || 0).toLocaleString()}
            </Typography>
            <Typography variant="caption" color="text.secondary">
              Market Cap
            </Typography>
          </Box>
        </Box>

        {/* Expanded Content */}
        <Collapse in={open} timeout="auto" unmountOnExit>
          <Box sx={{ p: 3, borderTop: 1, borderColor: 'divider' }}>
            <ExpandedRow pair={pair} />
          </Box>
        </Collapse>
      </Paper>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <Box sx={{ p: 2 }}>
      {/* Header */}
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center',
        gap: 2,
        px: 3,
        mb: 2 
      }}>
        <Typography variant="h6" sx={{ fontWeight: 600, flex: 2 }}>
          Token
        </Typography>
        <Typography variant="subtitle2" sx={{ flex: 1, color: 'text.secondary' }}>
          Price Change
        </Typography>
        <Typography variant="subtitle2" sx={{ flex: 1, textAlign: 'right', color: 'text.secondary' }}>
          Volume
        </Typography>
        <Typography variant="subtitle2" sx={{ flex: 1, textAlign: 'right', color: 'text.secondary' }}>
          Liquidity
        </Typography>
        <Typography variant="subtitle2" sx={{ flex: 1, textAlign: 'right', color: 'text.secondary' }}>
          Market Cap
        </Typography>
      </Box>

      {/* Rows */}
      {pairs.map((pair) => (
        <Row key={pair.address} pair={pair} />
      ))}

      {/* Pagination */}
      <Box sx={{ mt: 2, display: 'flex', justifyContent: 'flex-end' }}>
        <TablePagination
          rowsPerPageOptions={[10, 25, 50, 100]}
          component="div"
          count={totalCount}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          sx={{
            borderRadius: 2,
            border: 1,
            borderColor: 'divider',
            bgcolor: 'background.paper',
            '& .MuiTablePagination-select': {
              bgcolor: 'background.default',
              borderRadius: 1,
              p: 1
            }
          }}
        />
      </Box>
    </Box>
  );
};

export default PairsTable;
